import React from 'react';
import HomeHeroScene from '../assets/illustrations/home-hero-scene.svg'

function Home() {
  return (
    <div className="Home">
      <div className="logo"><Link to="/">Logo</Link></div>

      Home
      <img src={HomeHeroScene} alt='HomeHeroScene' />
    </div>
  );
}

export default Home;
